        public static int GetSkillLevelID(int points)
        {
            for (int i = 0; i < skill_levels.Count; i++)
            {
                if (points < skill_levels.ElementAt(i).Value)
                {
                    return i;
                }
            }
            return skill_levels.Count;
        }

        public static string GetSkillLevelName(int id)
        {
            return skill_levels.ElementAt(id - 1).Key;
        }

